  "privacy_content": "<h2>Adatvédelmi nyilatkozat</h2><p>Ez az adatvédelmi nyilatkozat a PharmaLedger Association Elektronikus termékinformációs termékének használatára vonatkozik.</p> <h2>Elérhetőségek</h2><ul class=\"list-space\" role=\"list\"><li role=\"listitem\"><b>a) A kezelő vagy közös kezelők azonosítása és elérhetőségei</b><p>Az Ön adatainak kezelője a PharmaLedger Association.</p></li><li role=\"listitem\"><b>b) Az adatvédelmi tisztviselő elérhetőségei</b><p>A PharmaLedger Association adatvédelmi hivatala az eldpo@pharmaledger.org e-mail-címen érhető el.</p></li></ul><h2>Milyen személyes adatokat használunk</h2><p>Kizárólag az elektronikus betegtájékoztató kézbesítéséhez szükséges adatokat gyűjtjük be. Ide tartozik az IP-címe, valamint az Őn által használt eszköz és böngésző technikai azonosítói.</p> <p><em>Részletesebben, az alábbi adatelemeket gyűjtjük be: </em></p><ul><li><p><em>Mobil eszköz hozzáférés.</em> Előfordulhat, hogy hozzáférést vagy engedélyt kérünk az eszköz funkcióinak használatára, beleértve a mobil eszköz kameráját és egyéb funkcióit. A hozzáférést vagy engedélyeket az eszköz beállításaiban módosíthatja.</p></li><li><p><em>Mobil eszköz adatai.</em> Automatikusan gyűjtjük az eszközre vonatkozó információkat (mint például a mobil eszköz azonosítója, típusa és gyártója), operációs rendszerre, verzióra és rendszerkonfigurációra vonatkozó információkat, eszköz és alkalmazás azonosítószámokat, böngésző típusát és verzióját, hardver típusa, internetes szolgáltató és/vagy mobilhordozó, valamint az IP-címet (Internet Protocol) (vagy proxy szervert). Amennyiben alkalmazásainkat használja, információkat gyűjthetünk a mobil eszközével kapcsolatos telefonhálózatról, mobil eszköze operációs rendszeréről vagy platformjáról, a mobil eszköz típusáról, mobil eszköze egyedi eszközazonosítójáról, valamint az Ön által igénybe vett alkalmazásaink funkcióiról. </p></li></ul><h2>Miért gyűjtjük az Ön személyes adatait</h2><p><b>Okok </b></p><p>A technikai adatait azért gyűjtjük, hogy elektronikus betegtájékoztatót nyújtsunk a gyógyszereihez. </p><p>A személyes információk feldolgozásának jogalapja:</p><ul><li><p><b>Szerződés teljesítése.</b> Személyes adatai feldolgozásra kerülhetnek, az Önnel szemben fennálló szerződéses kötelezettségek teljesítése érdekében, ideértve a Szolgáltatásaink nyújtását vagy az Ön kérésére a szerződéskötést megelőzően.</p></li><li><p><b>Jogi kötelezettségek.</b> Személyes adatai feldolgozásra kerülhetnek az érvényes jogi kötelezettségeink teljesítéséhez, mint például az egészségügyi szabályozás és közegészségügyi jogszabályok szerinti kötelezettségeink.</p></li></ul><h2>Kivel osztjuk meg az Ön személyes adatait</h2><p>Tagvállalatok és külső szolgáltatók</p><p>Adatait a következőkkel osztjuk meg: harmadik személyek, szolgáltatók, szerződő felek vagy ügynökök ('harmadik fél'), akik szolgáltatásokat nyújtanak számunkra vagy a mi nevünkben, és hozzáférést igényelnek a személyes adatokhoz a szolgáltatás teljesítéséhez. A személyes adatok védelme érdekében az adatok szolgáltatása harmadik félnek szerződés alapján történik. Ez azt jelenti, hogy nem kezelhetik az Ön személyes adatait, a felhatalmazásunk nélkül. Továbbá, nem oszthatják meg az Ön személyes adatait harmadik féllel. Emellett kötelezik magukat, hogy védjék a mi nevünkben tárolt adatokat, és azt az általunk megszabott időtartamig tárolják. A következő harmadik személyekkel oszthatjuk meg az Ön személyes adatait:</p><ul><li><p>Gyógyszergyártók (Tagvállalatok)</p></li><li><p>Technikai szolgáltatók</p></li></ul><h2>Mennyi ideig tároljuk az Ön adatait?</h2><p>A PharmaLedger Association az elektronikus tájékoztató igénylés feldolgozásához szükséges ideig tárolja az Ön adatait, legfeljebb 30 napig. </p><p>A gyógyszer gyártója is tárolja az Ön adatait az adatmegőrzési irányelvekben meghatározott ideig; az adatmegőrzéssel kapcsolatos további információkért kérjük, vegye fel a kapcsolatot gyógyszergyártóval.</p><h2>Amennyiben nem adja meg személyes adatait</h2><p>Amennyiben adatait nem bocsátja rendelkezésünkre, igénylésének nem tudunk eleget tenni.</p><h2>Az Ön jogai</h2><p>Ha élni kíván a GDPR szerinti jogaival a személyes adatainak kezelésével kapcsolatban, kérjük, vegye fel velünk a kapcsolatot a dpo@pharmaledger.org e-mail- címen.</p><p>Kérelmét 30 napon belül feldolgozzuk.</p><h2>Hozzájárulás visszavonása</h2><p>Ha élni kíván a GDPR szerinti jogaival a személyes adatainak kezelésével kapcsolatban, kérjük, vegye fel velünk a kapcsolatot a dpo@pharmaledger.org e-mail-címen. </p><p>Kérelmét 30 napon belül feldolgozzuk.</p><h2>Automatizált döntéshozatal</h2><p>Nem alkalmazunk automatizált döntéshozatali folyamatokat a szolgáltatás teljesítésében.</p><h2>Személyes adatok nemzetközi továbbítása</h2><p>Amennyiben a gyógyszergyártó megköveteli az adatok nem uniós országokba történő továbbítását, az Általános Szerződési Feltételeket alkalmazzuk a megfelelő adatvédelmi biztosítékok biztosítása.</p><h2>Panasz benyújtása</h2><p>Amennyiben élni kíván a GDPR szerinti jogaival a személyes adatainak kezelésével kapcsolatban, kérjük, vegye fel velünk a kapcsolatot a dpo@pharmaledger.org e-mail-címen.</p><p>Kérelmét 30 napon belül feldolgozzuk. Továbbá felügyeleti hatósághoz fordulhatnak, ha úgy véli, hogy megsértették a törvényben meghatározott jogait.</p>",
