  "terms_content": "<h2>Felhasználási feltételek a PharmaLedger Association elektronikus termékinformációs weboldalához és alkalmazásához </h2><p>A PharmaLedger Association elektronikus termékinformációs weboldalának és alkalmazásának használatával (\"Szolgáltatások\") jelzi, hogy elfogadja ezeket a használati feltételeket (\"Feltételek\") és vállalja a feltételek betartását. Ha nem ért egyet ezekkel a használati feltételekkel, kérjük, tartózkodjon a honlap és az alkalmazás használatától. A Szolgáltatásokat a PharmaLedger Association (\"Egyesület\") üzemelteti, azon személyek számára, akik információt igényelnek gyógyszereikkel kapcsolatosan. A Szolgáltatásokat több-résztvevős hálózat biztosítja, a betegtájékoztatókat a gyógyszergyártó szolgáltatja. Az Egyesület adatkezelőként működik ezen információkra vonatkozóan. </p><h2>Szolgáltatások igénybevétele </h2><p>A felhasználó szavatol azért, hogy a Szolgáltatásokat oly módon használja, hogy harmadik személyek jogait vagy a jogszabályokat sem közvetlenül, sem közvetett módon ne sértse, és ne korlátozza vagy gátolja a Szolgáltatások használatát vagy élvezetét harmadik személyek számára. Nem továbbít semmilyen jogszerűtlen, zaklató, becsületsértő, sérelmes, obszcén vagy sértő tartalmakat, a Szolgáltatásokon belüli párbeszéd normál folyamatát nem zavarja. </p><h2>Szellemi tulajdon </h2><p>A Szolgáltatások tartalma, beleértve, de nem korlátozva a következőkre: szövegek, képek, fényképek és szoftverek, az Egyesület vagy licencadói és tagvállalatai tulajdona és védett a hatályos szerzői jogi, szellemi-tulajdonnal kapcsolatos szabályozás által. A Szolgáltatások tartalmát tilos kereskedelmi célra kínálni az Egyesület kifejezett írásbeli hozzájárulása hiányában. </p><h2>Felelősség</h2><p>Az Egyesület semmilyen kifejezett vagy hallgatólagos felelősséget vagy kötelezettséget nem vállal a Szolgáltatások üzemeltetésére vonatkozóan vagy a Szolgáltatásokba foglalt információk, tartalmak, adatok vagy termékekre vonatkozóan. Az Egyesület nem vonható felelősségre a felhasználó által elszenvedett olyan károkért, amelyeket a Szolgáltatások használata eredményezett vagy okozott számára. Az Egyesület semmilyen közvetlen, közvetett, járulékos, speciális, következményi vagy büntető kártérítési felelősséggel nem tartozik. </p><h2>Irányadó jogszabályok </h2><p>A Felhasználási feltételekre a svájci törvények irányadók. Jogvita felmerülésekor minden esetben bázeli bíróság illetékes. </p><h2>Felhasználási feltételek módosítása </h2><p>Az Egyesület a Felhasználási feltételeket bármikor jogosult módosítani. A felhasználó felelősége ellenőrizni az esetleges módosításokat. A Szolgáltatások használatának folytatását a módosítások elfogadásának tekintjük.</p><p><br></p>",
