  "about_content": "<h2>Az alkalmazásról</h2>\n<p>A PharmaLedger® alkalmazás betegképviseleti szervezetek, gyógyszergyártó cégek és technológiai szakértők közös fejlesztése.</p><p>Az alkalmazás lehetővé teszi a felhasználók számára a gyógyszereikkel kapcsolatos információk megtekintését, a termékcsomagoláson található vonalkód beolvasásával.</p><p>A megjelenített információkat a forgalomba hozatali engedély jogosultja szolgáltatja.</p><h2>PharmaLedger</h2><p>A PharmaLedger® a PharmaLedger Association (PLA) védjegye.<p>A PLA egy globális, független nonprofit egyesület. Célja egy megbízható digitális ökoszisztéma kialakítása és népszerűsítése az egészségügyben.</p><p>Az egyesület támogatja az egészségügy és az élettudományi ágazatok együttműködését, valamint az innovációk megvalósítását a betegek és más érdekelt felek számára.</p>",
