  "help_content": "<div><p><b><h2>EPI</h2></b></p><p>Az <b>EPI</b> az <b>elektronikus betegtájékoztató</b> rövidítése. Ez a gyógyszerek papíralapú betegtájékoztatójának elektronikus változata. Bizonyos esetekben az <b>EPI</b> helyettesíti a papíralapú betegtájékoztatót.</p><p><b><h2>PharmaLedger</h2></b></p><p>A PharmaLedger Association (PLA) egy svájci székhelyű nonprofit egyesület, melynek célja egy megbízható digitális ökoszisztéma kialakítása és népszerűsítése az egészségügyben, egy szabványosított és megbízható nyílt forráskódú platform segítségével. A PLA támogatja az együttműködést, előmozdítja az innovációt és ennek megvalósítását az egészségügyben és az élettudományi ágazatokban, a betegek és egyéb érdekelt felek javára. A PLA 2022-ben alakult, a PharmaLedger projekt keretében elkezdett munka folytatására. A hároméves projekt az Európai Bizottság és a gyógyszeripar finanszírozásával jött létre és célja a blokchain megoldások hitelességének kiterjesztése volt. További információk az alábbi linken találhatók: https://pharmaledger.org.</p><p><b><h2>Mi a DataMatrix? </h2></b></p><p>A termékcsomagoláson feltüntetett fekete-fehér négyzet alakú vonalkód (lásd alább) <br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Hogyan használja az alkalmazást?</h2></b></p><p>Kövesse az <b>alkalmazás</b> kezdőlapján található utasításokat... a feltüntetett kép segítségével azonosítsa a termékcsomagoláson található <b>DataMatrix</b>-kódot, majd olvassa be a kódot a ‘ <b>DataMatrix</b>, beolvasása’ parancs segítségével. Engedélyezze az alkalmazásnak a kamera használatát a <b>DataMatrix</b> beolvasásához. Irányítsa a kamerát a <b>DataMatrix</b>-kódra. Sikeres beolvasás esetén az <b>EPI</b> elérhetővé válik. További részletekért kattintson a '+' gombra.</p><p><b><h2>Miért nem jelenik meg az EPI a DataMatrix beolvasása után? </h2></b></p><p>Több okból is előfordulhat, hogy a <b>DataMatrix</b> beolvasását követően nem jelenik meg EPI. Egyik ilyen ok lehet a kamera fókuszálása. Kérjük, próbálja meg egy jól megvilágított helyen, teljes egészében beolvasni a kódot. Amennyiben szükségesnek találja, támassza meg kezét egy felületen, hogy stabilan tartsa az eszközt.</p></div>",
